ＪＡＮコード：4987067827008 <br>商品の説明 衣類に貼るタイプのホッカイロです。温度持続時間は１２時間（４０度以上）。<br>通勤や通学をはじめスポーツ観戦やレジャー等など寒い場所でのご利用シーンに応じてご利用いただけます。 <br><br>使用上の注意 <br>・低温火傷防止の為就寝時には使用しないで下さい。<br>・コタツや布団の中での使用しないで下さい。 <br><br>保存方法 <br>直射日光を避け涼しい所に保管して下さい。<br>幼児の手の届く所に置かないで下さい。 <br><br>【原材料】<br>鉄粉・水・バーミキュライト・活性炭・塩類 <br>メーカー名 興和 <br>内容量 ３０個 <br>希望小売価格 2268円（税込）<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
